import React from 'react';
import ReactDOM from 'react-dom/client';

function App() {
  return (
    <div>
      <h1>Welcome to Chiderah Portfolio (React Frontend)</h1>
      <p>This is the new React.js frontend. Connect to your Django backend API for dynamic content.</p>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
